<!DOCTYPE html>
<html lang="de">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Versand Toolkit</title>
    
    <!-- PWA Meta Tags -->
    <link rel="manifest" href="manifest.json">
    <meta name="theme-color" content="#ffffff">
    <meta name="apple-mobile-web-app-capable" content="yes">
    <meta name="apple-mobile-web-app-status-bar-style" content="default">
    <meta name="apple-mobile-web-app-title" content="Versand">
    <link rel="apple-touch-icon" href="icon-192.png">

    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;500;600;700&display=swap" rel="stylesheet">
    <style>
        :root {
            --bg-color: #ffffff;
            --accent-color: #0071e3;
            --card-bg: #f5f5f7;
            --text-main: #1d1d1f;
            --text-secondary: #6e6e73;
            --border: #d2d2d7;
            --shadow: 0 4px 12px rgba(0, 0, 0, 0.05);
        }

        @media (prefers-color-scheme: dark) {
            :root {
                --bg-color: #000000;
                --accent-color: #0a84ff;
                --card-bg: #1c1c1e;
                --text-main: #f5f5f7;
                --text-secondary: #86868b;
                --border: #38383a;
                --shadow: 0 4px 12px rgba(0, 0, 0, 0.3);
            }
        }

        * {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
            -webkit-font-smoothing: antialiased;
        }

        body {
            font-family: 'Inter', -apple-system, system-ui, sans-serif;
            background-color: var(--bg-color);
            color: var(--text-main);
            overflow: hidden;
            height: 100vh;
            display: flex;
            flex-direction: column;
        }

        #dashboard {
            flex: 1;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            padding: 40px;
        }

        header {
            text-align: center;
            margin-bottom: 80px;
        }

        h1 {
            font-size: 40px;
            font-weight: 700;
            letter-spacing: -1px;
            margin-bottom: 8px;
        }

        p.subtitle {
            font-size: 20px;
            color: var(--text-secondary);
            font-weight: 400;
        }

        .tool-grid {
            display: grid;
            grid-template-columns: repeat(3, 1fr);
            gap: 32px;
            width: 100%;
            max-width: 1000px;
        }

        .tool-card {
            background: var(--card-bg);
            border: 1px solid var(--border);
            border-radius: 20px;
            padding: 50px 30px;
            text-align: center;
            cursor: pointer;
            transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            min-height: 280px;
        }

        .tool-card:hover {
            transform: translateY(-5px);
            background: var(--bg-color);
            border-color: var(--accent-color);
            box-shadow: 0 12px 24px rgba(0, 0, 0, 0.08);
        }

        .tool-card h2 {
            font-size: 24px;
            font-weight: 600;
            margin-bottom: 16px;
            color: var(--text-main);
        }

        .tool-card p {
            font-size: 16px;
            color: var(--text-secondary);
            line-height: 1.5;
            max-width: 240px;
        }

        #tool-container {
            display: none;
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: var(--bg-color);
            z-index: 20;
            flex-direction: column;
        }

        #tool-header {
            height: 52px;
            display: flex;
            align-items: center;
            padding: 0 16px;
            background: var(--bg-color);
            border-bottom: 1px solid var(--border);
        }

        .back-btn {
            background: transparent;
            color: var(--accent-color);
            border: none;
            padding: 4px 12px;
            border-radius: 8px;
            font-size: 15px;
            font-weight: 500;
            cursor: pointer;
            display: flex;
            align-items: center;
            gap: 6px;
            transition: background 0.2s;
        }

        .back-btn:hover {
            background: rgba(0, 113, 227, 0.05);
        }

        iframe {
            flex: 1;
            border: none;
            width: 100%;
            height: 100%;
        }

        #loading-overlay {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: var(--bg-color);
            z-index: 100;
            display: flex;
            align-items: center;
            justify-content: center;
            opacity: 1;
            transition: opacity 0.4s;
        }

        .spinner {
            width: 32px;
            height: 32px;
            border: 3px solid var(--border);
            border-top: 3px solid var(--accent-color);
            border-radius: 50%;
            animation: spin 0.8s linear infinite;
        }

        @keyframes spin {
            0% { transform: rotate(0deg); }
            100% { transform: rotate(360deg); }
        }
    </style>
</head>
<body>
    <div id="loading-overlay">
        <div class="spinner"></div>
    </div>

    <div id="dashboard">
        <header>
            <h1>Shipping Toolkit</h1>
            <p class="subtitle">W&auml;hlen Sie ein Tool aus.</p>
        </header>

        <div class="tool-grid">
            <div class="tool-card" onclick="openTool('versand')">
                <h2>Versandfreigabe</h2>
                <p>Pr&uuml;fung auf doppelte und Gew&auml;hrleistungs-Positionen.</p>
            </div>
            <div class="tool-card" onclick="openTool('geis')">
                <h2>Geis Tool</h2>
                <p>Spedition Geis Portal und PDF Optimierer.</p>
            </div>
            <div class="tool-card" onclick="openTool('gel')">
                <h2>GEL Tool</h2>
                <p>GEL Portal Express-Abfertigung und Toolkit.</p>
            </div>
        </div>
    </div>

    <div id="tool-container">
        <div id="tool-header">
            <button class="back-btn" onclick="closeTool()">
                <svg width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2.5" stroke-linecap="round" stroke-linejoin="round"><line x1="19" y1="12" x2="5" y2="12"></line><polyline points="12 19 5 12 12 5"></polyline></svg>
                Zur&uuml;ck
            </button>
            <span id="tool-title" style="margin-left: 16px; font-size: 14px; font-weight: 500; color: var(--text-secondary);">Tool Name</span>
        </div>
        <iframe id="tool-frame"></iframe>
    </div>

        function b64DecodeUnicode(str) {
            const binary = atob(str);
            const bytes = new Uint8Array(binary.length);
            for (let i = 0; i < binary.length; i++) {
                bytes[i] = binary.charCodeAt(i);
            }
            return new TextDecoder('utf-8').decode(bytes);
        }

        function openTool(id) {
            const dashboard = document.getElementById('dashboard');
            const container = document.getElementById('tool-container');
            const frame = document.getElementById('tool-frame');
            const title = document.getElementById('tool-title');

            const titles = {
                versand: 'Versandfreigabe',
                geis: 'Geis Portal Toolkit',
                gel: 'GEL Express Toolkit'
            };

            title.innerText = titles[id];
            
            try {
                frame.srcdoc = b64DecodeUnicode(tools[id]);
            } catch (e) {
                console.error("Decoding error:", e);
                frame.srcdoc = atob(tools[id]);
            }
            
            container.style.display = 'flex';
            dashboard.style.display = 'none';
        }

        function closeTool() {
            const dashboard = document.getElementById('dashboard');
            const container = document.getElementById('tool-container');
            const frame = document.getElementById('tool-frame');
            
            container.style.display = 'none';
            dashboard.style.display = 'flex';
            frame.srcdoc = '';
        }

        window.onload = () => {
            setTimeout(() => {
                document.getElementById('loading-overlay').style.opacity = '0';
                setTimeout(() => {
                    document.getElementById('loading-overlay').style.display = 'none';
                }, 400);
            }, 200);

            // Register Service Worker
            if ('serviceWorker' in navigator) {
                navigator.serviceWorker.register('sw.js')
                    .then(registration => console.log('SW registered:', registration))
                    .catch(error => console.log('SW registration failed:', error));
            }
        };
    </script>
